using Tests

@testset "3.1.2 (d x)^m (a+b log(c x^n))^p" begin
	@test integrate(x^3*log(c*x), x) == :(-x^4/16 + (x^4*log(c*x))/4)
	@test integrate(x^2*log(c*x), x) == :(-x^3/9 + (x^3*log(c*x))/3)
	@test integrate(x^1*log(c*x), x) == :(-x^2/4 + (x^2*log(c*x))/2)
	@test integrate(x^0*log(c*x), x) == :(-x + x*log(c*x))
	@test integrate(log(c*x)/x^1, x) == :(log(c*x)^2/2)
	@test integrate(log(c*x)/x^2, x) == :(-x^(-1) - log(c*x)/x)
	@test integrate(log(c*x)/x^3, x) == :(-1/(4*x^2) - log(c*x)/(2*x^2))
	@test integrate(x^3*log(c*x)^2, x) == :(x^4/32 - (x^4*log(c*x))/8 + (x^4*log(c*x)^2)/4)
	@test integrate(x^2*log(c*x)^2, x) == :((2*x^3)/27 - (2*x^3*log(c*x))/9 + (x^3*log(c*x)^2)/3)
	@test integrate(x^1*log(c*x)^2, x) == :(x^2/4 - (x^2*log(c*x))/2 + (x^2*log(c*x)^2)/2)
	@test integrate(x^0*log(c*x)^2, x) == :(2*x - 2*x*log(c*x) + x*log(c*x)^2)
	@test integrate(log(c*x)^2/x^1, x) == :(log(c*x)^3/3)
	@test integrate(log(c*x)^2/x^2, x) == :(-2/x - (2*log(c*x))/x - log(c*x)^2/x)
	@test integrate(log(c*x)^2/x^3, x) == :(-1/(4*x^2) - log(c*x)/(2*x^2) - log(c*x)^2/(2*x^2))
	@test integrate(x^3*log(c*x)^3, x) == :((-3*x^4)/128 + (3*x^4*log(c*x))/32 - (3*x^4*log(c*x)^2)/16 + (x^4*log(c*x)^3)/4)
	@test integrate(x^2*log(c*x)^3, x) == :((-2*x^3)/27 + (2*x^3*log(c*x))/9 - (x^3*log(c*x)^2)/3 + (x^3*log(c*x)^3)/3)
	@test integrate(x^1*log(c*x)^3, x) == :((-3*x^2)/8 + (3*x^2*log(c*x))/4 - (3*x^2*log(c*x)^2)/4 + (x^2*log(c*x)^3)/2)
	@test integrate(x^0*log(c*x)^3, x) == :(-6*x + 6*x*log(c*x) - 3*x*log(c*x)^2 + x*log(c*x)^3)
	@test integrate(log(c*x)^3/x^1, x) == :(log(c*x)^4/4)
	@test integrate(log(c*x)^3/x^2, x) == :(-6/x - (6*log(c*x))/x - (3*log(c*x)^2)/x - log(c*x)^3/x)
	@test integrate(log(c*x)^3/x^3, x) == :(-3/(8*x^2) - (3*log(c*x))/(4*x^2) - (3*log(c*x)^2)/(4*x^2) - log(c*x)^3/(2*x^2))
	@test integrate(x^3/log(c*x), x) == :(expIntegralEi(4*log(c*x))/c^4)
	@test integrate(x^2/log(c*x), x) == :(expIntegralEi(3*log(c*x))/c^3)
	@test integrate(x^1/log(c*x), x) == :(expIntegralEi(2*log(c*x))/c^2)
	@test integrate(x^0/log(c*x), x) == :(logIntegral(c*x)/c)
	@test integrate(1/(x^1*log(c*x)), x) == :(log(log(c*x)))
	@test integrate(1/(x^2*log(c*x)), x) == :(c*expIntegralEi(-log(c*x)))
	@test integrate(1/(x^3*log(c*x)), x) == :(c^2*expIntegralEi(-2*log(c*x)))
	@test integrate(x^3/log(c*x)^2, x) == :((4*expIntegralEi(4*log(c*x)))/c^4 - x^4/log(c*x))
	@test integrate(x^2/log(c*x)^2, x) == :((3*expIntegralEi(3*log(c*x)))/c^3 - x^3/log(c*x))
	@test integrate(x^1/log(c*x)^2, x) == :((2*expIntegralEi(2*log(c*x)))/c^2 - x^2/log(c*x))
	@test integrate(x^0/log(c*x)^2, x) == :(-(x/log(c*x)) + logIntegral(c*x)/c)
	@test integrate(1/(x^1*log(c*x)^2), x) == :(-log(c*x)^(-1))
	@test integrate(1/(x^2*log(c*x)^2), x) == :(-(c*expIntegralEi(-log(c*x))) - 1/(x*log(c*x)))
	@test integrate(1/(x^3*log(c*x)^2), x) == :(-2*c^2*expIntegralEi(-2*log(c*x)) - 1/(x^2*log(c*x)))
	@test integrate(x^3/log(c*x)^3, x) == :((8*expIntegralEi(4*log(c*x)))/c^4 - x^4/(2*log(c*x)^2) - (2*x^4)/log(c*x))
	@test integrate(x^2/log(c*x)^3, x) == :((9*expIntegralEi(3*log(c*x)))/(2*c^3) - x^3/(2*log(c*x)^2) - (3*x^3)/(2*log(c*x)))
	@test integrate(x^1/log(c*x)^3, x) == :((2*expIntegralEi(2*log(c*x)))/c^2 - x^2/(2*log(c*x)^2) - x^2/log(c*x))
	@test integrate(x^0/log(c*x)^3, x) == :(-(x/(2*log(c*x)^2)) - x/(2*log(c*x)) + logIntegral(c*x)/(2*c))
	@test integrate(1/(x^1*log(c*x)^3), x) == :(-1/(2*log(c*x)^2))
	@test integrate(1/(x^2*log(c*x)^3), x) == :((1/2)*c*expIntegralEi(-log(c*x)) - 1/(2*x*log(c*x)^2) + 1/(2*x*log(c*x)))
	@test integrate(1/(x^3*log(c*x)^3), x) == :(2*c^2*expIntegralEi(-2*log(c*x)) - 1/(2*x^2*log(c*x)^2) + 1/(x^2*log(c*x)))
	@test integrate(x^3*(a + b*log(c*x^n)), x) == :(-(b*n*x^4)/16 + (x^4*(a + b*log(c*x^n)))/4)
	@test integrate(x^2*(a + b*log(c*x^n)), x) == :(-(b*n*x^3)/9 + (x^3*(a + b*log(c*x^n)))/3)
	@test integrate(x^1*(a + b*log(c*x^n)), x) == :(-(b*n*x^2)/4 + (x^2*(a + b*log(c*x^n)))/2)
	@test integrate(x^0*(a + b*log(c*x^n)), x) == :(a*x - b*n*x + b*x*log(c*x^n))
	@test integrate((a + b*log(c*x^n))/x^1, x) == :((a + b*log(c*x^n))^2/(2*b*n))
	@test integrate((a + b*log(c*x^n))/x^2, x) == :(-((b*n)/x) - (a + b*log(c*x^n))/x)
	@test integrate((a + b*log(c*x^n))/x^3, x) == :(-(b*n)/(4*x^2) - (a + b*log(c*x^n))/(2*x^2))
	@test integrate(x^3*(a + b*log(c*x^n))^2, x) == :((b^2*n^2*x^4)/32 - (b*n*x^4*(a + b*log(c*x^n)))/8 + (x^4*(a + b*log(c*x^n))^2)/4)
	@test integrate(x^2*(a + b*log(c*x^n))^2, x) == :((2*b^2*n^2*x^3)/27 - (2*b*n*x^3*(a + b*log(c*x^n)))/9 + (x^3*(a + b*log(c*x^n))^2)/3)
	@test integrate(x^1*(a + b*log(c*x^n))^2, x) == :((b^2*n^2*x^2)/4 - (b*n*x^2*(a + b*log(c*x^n)))/2 + (x^2*(a + b*log(c*x^n))^2)/2)
	@test integrate(x^0*(a + b*log(c*x^n))^2, x) == :(-2*a*b*n*x + 2*b^2*n^2*x - 2*b^2*n*x*log(c*x^n) + x*(a + b*log(c*x^n))^2)
	@test integrate((a + b*log(c*x^n))^2/x^1, x) == :((a + b*log(c*x^n))^3/(3*b*n))
	@test integrate((a + b*log(c*x^n))^2/x^2, x) == :((-2*b^2*n^2)/x - (2*b*n*(a + b*log(c*x^n)))/x - (a + b*log(c*x^n))^2/x)
	@test integrate((a + b*log(c*x^n))^2/x^3, x) == :(-(b^2*n^2)/(4*x^2) - (b*n*(a + b*log(c*x^n)))/(2*x^2) - (a + b*log(c*x^n))^2/(2*x^2))
	@test integrate(x^3*(a + b*log(c*x^n))^3, x) == :((-3*b^3*n^3*x^4)/128 + (3*b^2*n^2*x^4*(a + b*log(c*x^n)))/32 - (3*b*n*x^4*(a + b*log(c*x^n))^2)/16 + (x^4*(a + b*log(c*x^n))^3)/4)
	@test integrate(x^2*(a + b*log(c*x^n))^3, x) == :((-2*b^3*n^3*x^3)/27 + (2*b^2*n^2*x^3*(a + b*log(c*x^n)))/9 - (b*n*x^3*(a + b*log(c*x^n))^2)/3 + (x^3*(a + b*log(c*x^n))^3)/3)
	@test integrate(x^1*(a + b*log(c*x^n))^3, x) == :((-3*b^3*n^3*x^2)/8 + (3*b^2*n^2*x^2*(a + b*log(c*x^n)))/4 - (3*b*n*x^2*(a + b*log(c*x^n))^2)/4 + (x^2*(a + b*log(c*x^n))^3)/2)
	@test integrate(x^0*(a + b*log(c*x^n))^3, x) == :(6*a*b^2*n^2*x - 6*b^3*n^3*x + 6*b^3*n^2*x*log(c*x^n) - 3*b*n*x*(a + b*log(c*x^n))^2 + x*(a + b*log(c*x^n))^3)
	@test integrate((a + b*log(c*x^n))^3/x^1, x) == :((a + b*log(c*x^n))^4/(4*b*n))
	@test integrate((a + b*log(c*x^n))^3/x^2, x) == :((-6*b^3*n^3)/x - (6*b^2*n^2*(a + b*log(c*x^n)))/x - (3*b*n*(a + b*log(c*x^n))^2)/x - (a + b*log(c*x^n))^3/x)
	@test integrate((a + b*log(c*x^n))^3/x^3, x) == :((-3*b^3*n^3)/(8*x^2) - (3*b^2*n^2*(a + b*log(c*x^n)))/(4*x^2) - (3*b*n*(a + b*log(c*x^n))^2)/(4*x^2) - (a + b*log(c*x^n))^3/(2*x^2))
	@test integrate((a + b*log(c*x^n))^3/x^4, x) == :((-2*b^3*n^3)/(27*x^3) - (2*b^2*n^2*(a + b*log(c*x^n)))/(9*x^3) - (b*n*(a + b*log(c*x^n))^2)/(3*x^3) - (a + b*log(c*x^n))^3/(3*x^3))
	@test integrate(x^3/(a + b*log(c*x^n)), x) == :((x^4*expIntegralEi((4*(a + b*log(c*x^n)))/(b*n)))/(b*exp(((4*a)/(b*n))*n*(c*x^n)^(4/n))))
	@test integrate(x^2/(a + b*log(c*x^n)), x) == :((x^3*expIntegralEi((3*(a + b*log(c*x^n)))/(b*n)))/(b*exp(((3*a)/(b*n))*n*(c*x^n)^(3/n))))
	@test integrate(x^1/(a + b*log(c*x^n)), x) == :((x^2*expIntegralEi((2*(a + b*log(c*x^n)))/(b*n)))/(b*exp(((2*a)/(b*n))*n*(c*x^n)^(2/n))))
	@test integrate(x^0/(a + b*log(c*x^n)), x) == :((x*expIntegralEi((a + b*log(c*x^n))/(b*n)))/(b*exp((a/(b*n))*n*(c*x^n)^n^(-1))))
	@test integrate(1/(x^1*(a + b*log(c*x^n))), x) == :(log(a + b*log(c*x^n))/(b*n))
	@test integrate(1/(x^2*(a + b*log(c*x^n))), x) == :((exp((a/(b*n))*(c*x^n)^n^(-1)*expIntegralEi)(-((a + b*log(c*x^n))/(b*n))))/(b*n*x))
	@test integrate(1/(x^3*(a + b*log(c*x^n))), x) == :((exp(((2*a)/(b*n))*(c*x^n)^(2/n)*expIntegralEi)((-2*(a + b*log(c*x^n)))/(b*n)))/(b*n*x^2))
	@test integrate(1/(x^4*(a + b*log(c*x^n))), x) == :((exp(((3*a)/(b*n))*(c*x^n)^(3/n)*expIntegralEi)((-3*(a + b*log(c*x^n)))/(b*n)))/(b*n*x^3))
	@test integrate(x^3/(a + b*log(c*x^n))^2, x) == :((4*x^4*expIntegralEi((4*(a + b*log(c*x^n)))/(b*n)))/(b^2*exp(((4*a)/(b*n))*n^2*(c*x^n)^(4/n)) - x^4/(b*n*(a + b*log)(c*x^n))))
	@test integrate(x^2/(a + b*log(c*x^n))^2, x) == :((3*x^3*expIntegralEi((3*(a + b*log(c*x^n)))/(b*n)))/(b^2*exp(((3*a)/(b*n))*n^2*(c*x^n)^(3/n)) - x^3/(b*n*(a + b*log)(c*x^n))))
	@test integrate(x^1/(a + b*log(c*x^n))^2, x) == :((2*x^2*expIntegralEi((2*(a + b*log(c*x^n)))/(b*n)))/(b^2*exp(((2*a)/(b*n))*n^2*(c*x^n)^(2/n)) - x^2/(b*n*(a + b*log)(c*x^n))))
	@test integrate(x^0/(a + b*log(c*x^n))^2, x) == :((x*expIntegralEi((a + b*log(c*x^n))/(b*n)))/(b^2*exp((a/(b*n))*n^2*(c*x^n)^n^(-1)) - x/(b*n*(a + b*log)(c*x^n))))
	@test integrate(1/(x^1*(a + b*log(c*x^n))^2), x) == :(-(1/(b*n*(a + b*log(c*x^n)))))
	@test integrate(1/(x^2*(a + b*log(c*x^n))^2), x) == :(-((exp((a/(b*n))*(c*x^n)^n^(-1)*expIntegralEi)(-((a + b*log(c*x^n))/(b*n))))/(b^2*n^2*x)) - 1/(b*n*x*(a + b*log(c*x^n))))
	@test integrate(1/(x^3*(a + b*log(c*x^n))^2), x) == :((-2*exp(((2*a)/(b*n))*(c*x^n)^(2/n)*expIntegralEi)((-2*(a + b*log(c*x^n)))/(b*n)))/(b^2*n^2*x^2) - 1/(b*n*x^2*(a + b*log(c*x^n))))
	@test integrate(1/(x^4*(a + b*log(c*x^n))^2), x) == :((-3*exp(((3*a)/(b*n))*(c*x^n)^(3/n)*expIntegralEi)((-3*(a + b*log(c*x^n)))/(b*n)))/(b^2*n^2*x^3) - 1/(b*n*x^3*(a + b*log(c*x^n))))
	@test integrate(x^3/(a + b*log(c*x^n))^3, x) == :((8*x^4*expIntegralEi((4*(a + b*log(c*x^n)))/(b*n)))/(b^3*exp(((4*a)/(b*n))*n^3*(c*x^n)^(4/n)) - x^4/(2*b*n*(a + b*log)(c*x^n))^2) - (2*x^4)/(b^2*n^2*(a + b*log(c*x^n))))
	@test integrate(x^2/(a + b*log(c*x^n))^3, x) == :((9*x^3*expIntegralEi((3*(a + b*log(c*x^n)))/(b*n)))/(2*b^3*exp(((3*a)/(b*n))*n^3*(c*x^n)^(3/n)) - x^3/(2*b*n*(a + b*log)(c*x^n))^2) - (3*x^3)/(2*b^2*n^2*(a + b*log(c*x^n))))
	@test integrate(x^1/(a + b*log(c*x^n))^3, x) == :((2*x^2*expIntegralEi((2*(a + b*log(c*x^n)))/(b*n)))/(b^3*exp(((2*a)/(b*n))*n^3*(c*x^n)^(2/n)) - x^2/(2*b*n*(a + b*log)(c*x^n))^2) - x^2/(b^2*n^2*(a + b*log(c*x^n))))
	@test integrate(x^0/(a + b*log(c*x^n))^3, x) == :((x*expIntegralEi((a + b*log(c*x^n))/(b*n)))/(2*b^3*exp((a/(b*n))*n^3*(c*x^n)^n^(-1)) - x/(2*b*n*(a + b*log)(c*x^n))^2) - x/(2*b^2*n^2*(a + b*log(c*x^n))))
	@test integrate(1/(x^1*(a + b*log(c*x^n))^3), x) == :(-1/(2*b*n*(a + b*log(c*x^n))^2))
	@test integrate(1/(x^2*(a + b*log(c*x^n))^3), x) == :((exp((a/(b*n))*(c*x^n)^n^(-1)*expIntegralEi)(-((a + b*log(c*x^n))/(b*n))))/(2*b^3*n^3*x) - 1/(2*b*n*x*(a + b*log(c*x^n))^2) + 1/(2*b^2*n^2*x*(a + b*log(c*x^n))))
	@test integrate(1/(x^3*(a + b*log(c*x^n))^3), x) == :((2*exp(((2*a)/(b*n))*(c*x^n)^(2/n)*expIntegralEi)((-2*(a + b*log(c*x^n)))/(b*n)))/(b^3*n^3*x^2) - 1/(2*b*n*x^2*(a + b*log(c*x^n))^2) + 1/(b^2*n^2*x^2*(a + b*log(c*x^n))))
	@test integrate(1/(x^4*(a + b*log(c*x^n))^3), x) == :((9*exp(((3*a)/(b*n))*(c*x^n)^(3/n)*expIntegralEi)((-3*(a + b*log(c*x^n)))/(b*n)))/(2*b^3*n^3*x^3) - 1/(2*b*n*x^3*(a + b*log(c*x^n))^2) + 3/(2*b^2*n^2*x^3*(a + b*log(c*x^n))))
	@test integrate((d*x)^(5/2)*(a + b*log(c*x^n)), x) == :((-4*b*n*(d*x)^(7/2))/(49*d) + (2*(d*x)^(7/2)*(a + b*log(c*x^n)))/(7*d))
	@test integrate((d*x)^(3/2)*(a + b*log(c*x^n)), x) == :((-4*b*n*(d*x)^(5/2))/(25*d) + (2*(d*x)^(5/2)*(a + b*log(c*x^n)))/(5*d))
	@test integrate((d*x)^(1/2)*(a + b*log(c*x^n)), x) == :((-4*b*n*(d*x)^(3/2))/(9*d) + (2*(d*x)^(3/2)*(a + b*log(c*x^n)))/(3*d))
	@test integrate((a + b*log(c*x^n))/(d*x)^(1/2), x) == :((-4*b*n*sqrt(d*x))/d + (2*sqrt(d*x)*(a + b*log(c*x^n)))/d)
	@test integrate((a + b*log(c*x^n))/(d*x)^(3/2), x) == :((-4*b*n)/(d*sqrt(d*x)) - (2*(a + b*log(c*x^n)))/(d*sqrt(d*x)))
	@test integrate((a + b*log(c*x^n))/(d*x)^(5/2), x) == :((-4*b*n)/(9*d*(d*x)^(3/2)) - (2*(a + b*log(c*x^n)))/(3*d*(d*x)^(3/2)))
	@test integrate((d*x)^(5/2)*(a + b*log(c*x^n))^2, x) == :((16*b^2*n^2*(d*x)^(7/2))/(343*d) - (8*b*n*(d*x)^(7/2)*(a + b*log(c*x^n)))/(49*d) + (2*(d*x)^(7/2)*(a + b*log(c*x^n))^2)/(7*d))
	@test integrate((d*x)^(3/2)*(a + b*log(c*x^n))^2, x) == :((16*b^2*n^2*(d*x)^(5/2))/(125*d) - (8*b*n*(d*x)^(5/2)*(a + b*log(c*x^n)))/(25*d) + (2*(d*x)^(5/2)*(a + b*log(c*x^n))^2)/(5*d))
	@test integrate((d*x)^(1/2)*(a + b*log(c*x^n))^2, x) == :((16*b^2*n^2*(d*x)^(3/2))/(27*d) - (8*b*n*(d*x)^(3/2)*(a + b*log(c*x^n)))/(9*d) + (2*(d*x)^(3/2)*(a + b*log(c*x^n))^2)/(3*d))
	@test integrate((a + b*log(c*x^n))^2/(d*x)^(1/2), x) == :((16*b^2*n^2*sqrt(d*x))/d - (8*b*n*sqrt(d*x)*(a + b*log(c*x^n)))/d + (2*sqrt(d*x)*(a + b*log(c*x^n))^2)/d)
	@test integrate((a + b*log(c*x^n))^2/(d*x)^(3/2), x) == :((-16*b^2*n^2)/(d*sqrt(d*x)) - (8*b*n*(a + b*log(c*x^n)))/(d*sqrt(d*x)) - (2*(a + b*log(c*x^n))^2)/(d*sqrt(d*x)))
	@test integrate((a + b*log(c*x^n))^2/(d*x)^(5/2), x) == :((-16*b^2*n^2)/(27*d*(d*x)^(3/2)) - (8*b*n*(a + b*log(c*x^n)))/(9*d*(d*x)^(3/2)) - (2*(a + b*log(c*x^n))^2)/(3*d*(d*x)^(3/2)))
	@test integrate((d*x)^(5/2)/(a + b*log(c*x^n)), x) == :(((d*x)^(7/2)*expIntegralEi((7*(a + b*log(c*x^n)))/(2*b*n)))/(b*d*exp(((7*a)/(2*b*n))*n*(c*x^n)^(7/(2*n)))))
	@test integrate((d*x)^(3/2)/(a + b*log(c*x^n)), x) == :(((d*x)^(5/2)*expIntegralEi((5*(a + b*log(c*x^n)))/(2*b*n)))/(b*d*exp(((5*a)/(2*b*n))*n*(c*x^n)^(5/(2*n)))))
