@testset "3.4 u (a+b log(c (d+e x^m)^n))^p" begin
	@test integrate(x^4*log(c*(a + b*x^2)^p), x) == :(-((2*a^2*p*x)/(5*b^2)) + (2*a*p*x^3)/(15*b) - (2*p*x^5)/25 + (2*a^(5/2)*p*atan((sqrt(b)*x)/sqrt(a)))/(5*b^(5/2)) + (1/5)*x^5*log(c*(a + b*x^2)^p))
	@test integrate(x^3*log(c*(a + b*x^2)^p), x) == :((a*p*x^2)/(4*b) - (p*x^4)/8 - (a^2*p*log(a + b*x^2))/(4*b^2) + (1/4)*x^4*log(c*(a + b*x^2)^p))
	@test integrate(x^2*log(c*(a + b*x^2)^p), x) == :((2*a*p*x)/(3*b) - (2*p*x^3)/9 - (2*a^(3/2)*p*atan((sqrt(b)*x)/sqrt(a)))/(3*b^(3/2)) + (1/3)*x^3*log(c*(a + b*x^2)^p))
	@test integrate(x^1*log(c*(a + b*x^2)^p), x) == :(-((p*x^2)/2) + ((a + b*x^2)*log(c*(a + b*x^2)^p))/(2*b))
	@test integrate(x^0*log(c*(a + b*x^2)^p), x) == :(-2*p*x + (2*sqrt(a)*p*atan((sqrt(b)*x)/sqrt(a)))/sqrt(b) + x*log(c*(a + b*x^2)^p))
	# @test integrate(log(c*(a + b*x^2)^p)/x^1, x, 3) == :(1 + (b*x^2)/a))
	@test integrate(log(c*(a + b*x^2)^p)/x^2, x) == :((2*sqrt(b)*p*atan((sqrt(b)*x)/sqrt(a)))/sqrt(a) - log(c*(a + b*x^2)^p)/x)
	@test integrate(log(c*(a + b*x^2)^p)/x^3, x, 5) == :((b*p*log(x))/a - (b*p*log(a + b*x^2))/(2*a) - log(c*(a + b*x^2)^p)/(2*x^2))
	@test integrate(log(c*(a + b*x^2)^p)/x^4, x) == :(-((2*b*p)/(3*a*x)) - (2*b^(3/2)*p*atan((sqrt(b)*x)/sqrt(a)))/(3*a^(3/2)) - log(c*(a + b*x^2)^p)/(3*x^3))
	@test integrate(log(c*(a + b*x^2)^p)/x^5, x) == :(-((b*p)/(4*a*x^2)) - (b^2*p*log(x))/(2*a^2) + (b^2*p*log(a + b*x^2))/(4*a^2) - log(c*(a + b*x^2)^p)/(4*x^4))
	@test integrate(log(c*(a + b*x^2)^p)/x^6, x) == :(-((2*b*p)/(15*a*x^3)) + (2*b^2*p)/(5*a^2*x) + (2*b^(5/2)*p*atan((sqrt(b)*x)/sqrt(a)))/(5*a^(5/2)) - log(c*(a + b*x^2)^p)/(5*x^5))
	@test integrate(log(c*(a + b*x^2)^p)/x^7, x) == :(-((b*p)/(12*a*x^4)) + (b^2*p)/(6*a^2*x^2) + (b^3*p*log(x))/(3*a^3) - (b^3*p*log(a + b*x^2))/(6*a^3) - log(c*(a + b*x^2)^p)/(6*x^6))
	@test integrate(x^5*log(c*(a + b*x^3)^p), x) == :((a*p*x^3)/(6*b) - (p*x^6)/12 - (a^2*p*log(a + b*x^3))/(6*b^2) + (1/6)*x^6*log(c*(a + b*x^3)^p))
	@test integrate(x^4*log(c*(a + b*x^3)^p), x) == :((3*a*p*x^2)/(10*b) - (3*p*x^5)/25 + (sqrt(3)*a^(5/3)*p*atan((a^(1/3) - 2*b^(1/3)*x)/(sqrt(3)*a^(1/3))))/(5*b^(5/3)) + (a^(5/3)*p*log(a^(1/3) + b^(1/3)*x))/(5*b^(5/3)) - (a^(5/3)*p*log(a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2))/(10*b^(5/3)) + (1/5)*x^5*log(c*(a + b*x^3)^p))
	@test integrate(x^3*log(c*(a + b*x^3)^p), x) == :((3*a*p*x)/(4*b) - (3*p*x^4)/16 + (sqrt(3)*a^(4/3)*p*atan((a^(1/3) - 2*b^(1/3)*x)/(sqrt(3)*a^(1/3))))/(4*b^(4/3)) - (a^(4/3)*p*log(a^(1/3) + b^(1/3)*x))/(4*b^(4/3)) + (a^(4/3)*p*log(a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2))/(8*b^(4/3)) + (1/4)*x^4*log(c*(a + b*x^3)^p))
	@test integrate(x^2*log(c*(a + b*x^3)^p), x) == :(-((p*x^3)/3) + ((a + b*x^3)*log(c*(a + b*x^3)^p))/(3*b))
	@test integrate(x^1*log(c*(a + b*x^3)^p), x) == :(-((3*p*x^2)/4) - (sqrt(3)*a^(2/3)*p*atan((a^(1/3) - 2*b^(1/3)*x)/(sqrt(3)*a^(1/3))))/(2*b^(2/3)) - (a^(2/3)*p*log(a^(1/3) + b^(1/3)*x))/(2*b^(2/3)) + (a^(2/3)*p*log(a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2))/(4*b^(2/3)) + (1/2)*x^2*log(c*(a + b*x^3)^p))
	@test integrate(x^0*log(c*(a + b*x^3)^p), x) == :(-3*p*x - (sqrt(3)*a^(1/3)*p*atan((a^(1/3) - 2*b^(1/3)*x)/(sqrt(3)*a^(1/3))))/b^(1/3) + (a^(1/3)*p*log(a^(1/3) + b^(1/3)*x))/b^(1/3) - (a^(1/3)*p*log(a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2))/(2*b^(1/3)) + x*log(c*(a + b*x^3)^p))
	# @test integrate(log(c*(a + b*x^3)^p)/x^1, x, 3) == :(1 + (b*x^3)/a))
	@test integrate(log(c*(a + b*x^3)^p)/x^2, x) == :(-((sqrt(3)*b^(1/3)*p*atan((a^(1/3) - 2*b^(1/3)*x)/(sqrt(3)*a^(1/3))))/a^(1/3)) - (b^(1/3)*p*log(a^(1/3) + b^(1/3)*x))/a^(1/3) + (b^(1/3)*p*log(a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2))/(2*a^(1/3)) - log(c*(a + b*x^3)^p)/x)
	@test integrate(log(c*(a + b*x^3)^p)/x^3, x) == :(-((sqrt(3)*b^(2/3)*p*atan((a^(1/3) - 2*b^(1/3)*x)/(sqrt(3)*a^(1/3))))/(2*a^(2/3))) + (b^(2/3)*p*log(a^(1/3) + b^(1/3)*x))/(2*a^(2/3)) - (b^(2/3)*p*log(a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2))/(4*a^(2/3)) - log(c*(a + b*x^3)^p)/(2*x^2))
	@test integrate(log(c*(a + b*x^3)^p)/x^4, x) == :((b*p*log(x))/a - (b*p*log(a + b*x^3))/(3*a) - log(c*(a + b*x^3)^p)/(3*x^3))
	@test integrate(log(c*(a + b*x^3)^p)/x^5, x) == :(-((3*b*p)/(4*a*x)) + (sqrt(3)*b^(4/3)*p*atan((a^(1/3) - 2*b^(1/3)*x)/(sqrt(3)*a^(1/3))))/(4*a^(4/3)) + (b^(4/3)*p*log(a^(1/3) + b^(1/3)*x))/(4*a^(4/3)) - (b^(4/3)*p*log(a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2))/(8*a^(4/3)) - log(c*(a + b*x^3)^p)/(4*x^4))
	@test integrate(log(c*(a + b*x^3)^p)/x^6, x) == :(-((3*b*p)/(10*a*x^2)) + (sqrt(3)*b^(5/3)*p*atan((a^(1/3) - 2*b^(1/3)*x)/(sqrt(3)*a^(1/3))))/(5*a^(5/3)) - (b^(5/3)*p*log(a^(1/3) + b^(1/3)*x))/(5*a^(5/3)) + (b^(5/3)*p*log(a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2))/(10*a^(5/3)) - log(c*(a + b*x^3)^p)/(5*x^5))
	@test integrate(log(c*(a + b*x^3)^p)/x^7, x) == :(-((b*p)/(6*a*x^3)) - (b^2*p*log(x))/(2*a^2) + (b^2*p*log(a + b*x^3))/(6*a^2) - log(c*(a + b*x^3)^p)/(6*x^6))
	@test integrate(x^4*log(c*(a + b/x)^p), x) == :(-((b^4*p*x)/(5*a^4)) + (b^3*p*x^2)/(10*a^3) - (b^2*p*x^3)/(15*a^2) + (b*p*x^4)/(20*a) + (1/5)*x^5*log(c*(a + b/x)^p) + (b^5*p*log(b + a*x))/(5*a^5))
	@test integrate(x^3*log(c*(a + b/x)^p), x) == :((b^3*p*x)/(4*a^3) - (b^2*p*x^2)/(8*a^2) + (b*p*x^3)/(12*a) + (1/4)*x^4*log(c*(a + b/x)^p) - (b^4*p*log(b + a*x))/(4*a^4))
	@test integrate(x^2*log(c*(a + b/x)^p), x) == :(-((b^2*p*x)/(3*a^2)) + (b*p*x^2)/(6*a) + (1/3)*x^3*log(c*(a + b/x)^p) + (b^3*p*log(b + a*x))/(3*a^3))
	@test integrate(x^1*log(c*(a + b/x)^p), x) == :((b*p*x)/(2*a) + (1/2)*x^2*log(c*(a + b/x)^p) - (b^2*p*log(b + a*x))/(2*a^2))
	@test integrate(x^0*log(c*(a + b/x)^p), x) == :(x*log(c*(a + b/x)^p) + (b*p*log(b + a*x))/a)
	# @test integrate(log(c*(a + b/x)^p)/x^1, x, 3) == :(1 + b/(a*x)))
	@test integrate(log(c*(a + b/x)^p)/x^2, x) == :(p/x - ((a + b/x)*log(c*(a + b/x)^p))/b)
	@test integrate(log(c*(a + b/x)^p)/x^3, x) == :(p/(4*x^2) - (a*p)/(2*b*x) + (a^2*p*log(a + b/x))/(2*b^2) - log(c*(a + b/x)^p)/(2*x^2))
	@test integrate(log(c*(a + b/x)^p)/x^4, x) == :(p/(9*x^3) - (a*p)/(6*b*x^2) + (a^2*p)/(3*b^2*x) - (a^3*p*log(a + b/x))/(3*b^3) - log(c*(a + b/x)^p)/(3*x^3))
